import { ADD, EXCLUDE } from './actionsTypes';

const clientsAction = (name, age, email) => ({
  type: ADD,
  payload: {
    name,
    age,
    email,
  }
});

const clientsExcludeAction = () => ({
  type: EXCLUDE,
  payload: {
    name,
    age,
    email,
  }
});

export default clientsAction;
